import React, { useState, useEffect } from "react";
import { Button } from "@mui/material";
import "./Button.css";
const MyButton = (props) => {

    const [data, setData] = useState(null);

  useEffect(() => {
    fetch("http://127.0.0.1:5000")
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        setData(data);
        console.log(data);
      });
  }, []);
  return (
    <div className="myBtn">
      <Button
        variant="contained"
        style={{
          borderRadius: 20,
          backgroundColor: "#228B22",
          maxWidth: "7000px",
          maxHeight: "100px",
          minWidth: "500px",
          minHeight: "50px",
        }}
      >
        Start
      </Button>
    </div>
  );
};

export default MyButton;
